import React, { useState, useEffect, useMemo, useCallback } from "react";
import { Tabs, Tab } from "react-bootstrap";
import Map from "./components/Map";
import useFetchData from "./hooks/useFetchData"; // Custom Hook for API Calls
import "./TriggerDemo.css";

const TriggerDemo = () => {
  const [form, setForm] = useState({
    triggerName: "",
    triggerDirection: "",
    selectedZone: "",
    selectedParentZone: "",
    topElevation: 8,
    bottomElevation: -1,
    triggerColor: "red",
    showMapForDrawing: false,
    useLeaflet: false,
    zoneName: "",
    selectedZoneForEdit: "",
  });

  const [eventList, setEventList] = useState([]);
  const [coordinates, setCoordinates] = useState("");
  const [editedVertices, setEditedVertices] = useState({});
  const [zoneVertices, setZoneVertices] = useState([]);

  // ✅ Custom Hook to Fetch Data
  const { data, loading, error, fetchData } = useFetchData({
    maps: "/maps/get_maps",
    parentZones: "/api/get_parent_zones",
    triggerDirections: "/api/list_trigger_directions",
    zones: "/api/get_all_zones",
  });

  const { maps = [], parentZones = [], triggerDirections = [], zones = [] } = data;

  // ✅ Optimized API calls
  useEffect(() => {
    fetchData();
  }, []);

  // ✅ Extracted function to handle form updates
  const handleInputChange = (e) => {
    setForm((prev) => ({ ...prev, [e.target.name]: e.target.value }));
  };

  const handleCreateTrigger = useCallback(async () => {
    if (!form.triggerName || !form.selectedZone || !form.triggerDirection) {
      alert("Please fill all required fields.");
      return;
    }

    if (!form.showMapForDrawing) {
      setForm((prev) => ({ ...prev, showMapForDrawing: true }));
      return;
    }

    if (!coordinates) {
      alert("Please draw the trigger on the map.");
      return;
    }

    const directionId = triggerDirections.find(
      (dir) => dir.x_dir === form.triggerDirection
    )?.i_dir;

    if (!directionId) {
      alert("Invalid direction selected.");
      return;
    }

    const triggerData = {
      name: form.triggerName,
      direction: directionId,
      zone_id: parseInt(form.selectedZone),
      ignore: true,
      coordinates: JSON.parse(coordinates),
    };

    try {
      const response = await fetch("/api/add_trigger", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(triggerData),
      });

      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }

      const result = await response.json();
      alert(`Trigger created with ID: ${result.trigger_id}`);
      setEventList((prev) => [
        ...prev,
        `${form.triggerName} created at ${coordinates} with ${form.triggerDirection} direction`,
      ]);
      setCoordinates("");
      setForm((prev) => ({ ...prev, showMapForDrawing: false }));
    } catch (error) {
      console.error("Error creating trigger:", error);
      alert(`Error creating trigger: ${error.message}`);
    }
  }, [form, coordinates, triggerDirections]);

  return (
    <div>
      <h1>ParcoRTLS Trigger Management</h1>
      <Tabs defaultActiveKey="mapAndTrigger" id="trigger-demo-tabs">
        <Tab eventKey="mapAndTrigger" title="Map & Trigger">
          <div className="trigger-map-section">
            {error && <div style={{ color: "red" }}>{error}</div>}
            <div className="trigger-form">
              <h3>Create Trigger</h3>
              <input
                type="text"
                placeholder="Trigger Name"
                name="triggerName"
                value={form.triggerName}
                onChange={handleInputChange}
              />
              <select
                name="selectedParentZone"
                value={form.selectedParentZone}
                onChange={handleInputChange}
              >
                <option value="">Select Parent Zone</option>
                {loading.parentZones ? (
                  <option value="">Loading...</option>
                ) : (
                  parentZones.map((pz) => (
                    <option key={pz.zone_id} value={pz.zone_id.toString()}>
                      {pz.name}
                    </option>
                  ))
                )}
              </select>
              <button onClick={handleCreateTrigger}>
                {form.showMapForDrawing ? "Save Trigger" : "Create Trigger"}
              </button>
            </div>
            {form.showMapForDrawing && (
              <Map
                key={form.selectedZone}
                zoneId={parseInt(form.selectedZone)}
                onDrawComplete={setCoordinates}
                triggerColor={form.triggerColor}
                useLeaflet={form.useLeaflet}
              />
            )}
          </div>
        </Tab>
      </Tabs>
    </div>
  );
};

export default TriggerDemo;
